// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

// abi.encodePacked()
// https://docs.soliditylang.org/en/v0.8.13/abi-spec.html#non-standard-packed-mode

contract GasPackingTest {
	constructor() {}

	function encode_one_by_one() public pure returns (string memory) {
		bytes memory result = abi.encodePacked("<START>");
		for(uint256 i = 0 ; i < 256 ; ++i) {
			result = abi.encodePacked(result,"<______>");
		}
		result = abi.encodePacked(result,"<END>");
		return string(result);
	}

	function encode_nulls() public pure returns (string memory) {
		bytes memory result = abi.encodePacked("<START>");
		for(uint256 i = 0 ; i < 256 ; ++i) {
			result = abi.encodePacked(result,i==0?"<______>":"");
		}
		result = abi.encodePacked(result,"<END>");
		return string(result);
	}

	function encode_lines() public pure returns (string memory) {
		bytes memory result = abi.encodePacked("<START>");
		for(uint256 i = 0 ; i < 16 ; ++i) {
			bytes memory line;
			for(uint256 j = 0 ; j < 16 ; ++j) {
				line = abi.encodePacked(line,"<______>");
			}
			result = abi.encodePacked(result,line);
		}
		result = abi.encodePacked(result,"<END>");
		return string(result);
	}

	function encode_lines_batch() public pure returns (string memory) {
		bytes memory result = abi.encodePacked("<START>");
		bytes[16] memory lines;
		for(uint256 i = 0 ; i < 16 ; ++i) {
			for(uint256 j = 0 ; j < 16 ; ++j) {
				lines[i] = abi.encodePacked(lines[i],"<______>");
			}
		}
		result = abi.encodePacked(result,
			lines[0],lines[1],lines[2],lines[3],
			lines[4],lines[5],lines[6],lines[7]);
		result = abi.encodePacked(result,
			lines[8],lines[9],lines[10],lines[11],
			lines[12],lines[13],lines[14],lines[15]);
		result = abi.encodePacked(result,"<END>");
		return string(result);
	}

	function encode_array() public pure returns (string memory) {
		bytes memory result = abi.encodePacked("<START>");
		bytes[256] memory arr;
		for(uint256 i = 0 ; i < 256 ; ++i) {
			arr[i] = bytes("<______>");
		}
		// result = abi.encodePacked(result,arr);
		result = abi.encodePacked(result,"<END>");
		return string(result);
	}

}
